  // lib/aggregators/breadcrumb.ts
  function makeBreadCrumb(htmlPath) {
    let breadCrumbMetaList = new Array();
    const relativePath = this.relative(this.cwd(), htmlPath);
    const pathTree = relativePath.split(this.sep);
    const sourceIsIndex = this.basename(htmlPath) === "index.html";
    const levelCounts = sourceIsIndex ? pathTree.length - 1 : pathTree.length;
    let realLevel = levelCounts;
    for (let i = 0; i < levelCounts; i++) {
      if (i === 0) {
        let itemUrl = pathTree.join(this.sep);
        const preserveBasename = sourceIsIndex ? false : true;
        const listItem = this.generateMeta(
          itemUrl,
          realLevel,
          preserveBasename
        );
        breadCrumbMetaList.push(listItem);
        pathTree.pop();
        if (sourceIsIndex) pathTree.pop();
      } else {
        const requiredFile = pathTree.join(this.sep) + `${this.sep}index.html`;
        if (this.existsSync(requiredFile)) {
          const listItem = this.generateMeta(
            requiredFile,
            realLevel,
            false
          );
          breadCrumbMetaList.push(listItem);
        } else {
          breadCrumbMetaList = breadCrumbMetaList.map((meta) => {
            meta.position = meta.position - 1;
            return meta;
          });
        }
        pathTree.pop();
      }
      realLevel -= 1;
    }
    return { breadCrumbMetas: breadCrumbMetaList.reverse() };
  }

