  // lib/aggregators/software-app.ts
  function makeSoftwareApp(htmlString) {
    const $ = this.htmlParser(htmlString);
    const softwareAppBaseID = this.reservedNames.softwareApp.baseID;
    const softwareAppMetas = {};
    $(`[class^="${softwareAppBaseID}-"]`).each(
      (_index, elem) => {
        const [id, type] = elemTypeAndIDExtracter(
          $,
          elem,
          softwareAppBaseID
        );
        if (!Object.keys(softwareAppMetas).includes(id)) {
          softwareAppMetas[id] = {};
          softwareAppMetas[id].aggregateRating = {};
          softwareAppMetas[id].operatingSystem = [];
        }
        const elemInner = $(elem)?.html()?.trim();
        if (type === this.reservedNames.common.heroName) {
          softwareAppMetas[id].name = elemInner;
        } else if (type === this.reservedNames.softwareApp.category) {
          softwareAppMetas[id].category = partialCategoryMatch(
            elemInner
          );
        } else if (type === this.reservedNames.softwareApp.operatingSystem) {
          const currentOSList = elemInner.split(this.reservedNames.softwareApp.OSSeperator).map((elem2) => elem2.toUpperCase());
          const oldOSList = softwareAppMetas[id].operatingSystem;
          softwareAppMetas[id].operatingSystem = oldOSList.concat(currentOSList);
        } else if (type === this.reservedNames.aggregateRating.wrapper) {
          softwareAppMetas[id].aggregateRating.ratingValue = parseFloat(
            $(elem).find(
              `.${this.reservedNames.aggregateRating.aggregatedRatingValue}`
            ).html() ?? "0"
          );
          softwareAppMetas[id].aggregateRating.maxRateRange = parseFloat(
            $(elem).find(
              `.${this.reservedNames.aggregateRating.maxRangeOfRating}`
            ).html() ?? "0"
          );
          softwareAppMetas[id].aggregateRating.numberOfRatings = parseInt(
            $(elem).find(`.${this.reservedNames.aggregateRating.numberOfRatings}`).html() ?? "0"
          );
        } else if (type === this.reservedNames.common.heroCost) {
          const currency = $(elem)?.data(
            this.reservedNames.common.currencyDataVar
          );
          if (!currency) {
            throw new Error(
              `Add data-${this.reservedNames.common.currencyDataVar} in price element 
Reference ID: ${id}`
            );
          }
          softwareAppMetas[id].offer = {
            price: parseFloat(elemInner),
            priceCurrency: currency.toUpperCase()
          };
        }
      }
    );
    return Object.values(softwareAppMetas);
  }

  // lib/aggregators/video.ts
  async function makeVideo(htmlString) {
    const $ = this.htmlParser(htmlString);
    const videoBaseID = this.reservedNames.video.baseID;
    const videoMetas = {};
    const videoMetaPromises = new Array();
    $(`[class^="${videoBaseID}-"]`).each((_index, elem) => {
      const [id, type] = elemTypeAndIDExtracter($, elem, videoBaseID);
      if (!Object.keys(videoMetas).includes(id)) {
        videoMetas[id] = {};
        videoMetas[id].hasPart = [];
      }
      if (type === this.reservedNames.common.videoFrame) {
        const embedUrl = $(elem)?.attr("src");
        videoMetaPromises.push(
          (async () => {
            videoMetas[id] = {
              ...await this.ytVideoMeta(embedUrl),
              ...videoMetas[id]
            };
          })()
        );
      } else if (type === this.reservedNames.video.segmentsWrapper) {
        const clips = $(elem)?.children();
        clips.each((index2, clip) => {
          const name = $(clip)?.html();
          const start = parseFloat(
            $(clip)?.data(
              this.reservedNames.video.startOffsetDataVar
            ) ?? "0"
          );
          const approximatedEnd = 5;
          const nextClipElem = clips[index2 + 1];
          const end2 = parseFloat(
            $(nextClipElem)?.data(
              this.reservedNames.video.startOffsetDataVar
            ) ?? start + approximatedEnd
          );
          videoMetas[id].hasPart?.push({
            name,
            startOffset: start,
            endOffset: end2
          });
        });
      }
    });
    await Promise.all(videoMetaPromises);
    return Object.values(videoMetas);
  }

